import React from "react";
import { Button, Icon } from "semantic-ui-react";

export default function Menu({ menuOpen, getAccessToken }) {
  return (
    <div className={`sidemenu ${menuOpen ? "active-menu" : ""}`}>
      <div className="button-wrapper">
        <button className="button-primary" onClick={getAccessToken}>
          Login
        </button>
        <Button icon className="icon-btn" active="false">
          <Icon name="search" size="big" />
          <div className="btn-text">Search Artists</div>
        </Button>
        <Button icon className="icon-btn">
          <Icon name="star" size="big" />
          <div className="btn-text">Search Artists</div>
        </Button>
      </div>
    </div>
  );
}
